// Import the functions you need from the SDKs you need
import { initializeApp } from "firebase/app";
import { getAuth, createUserWithEmailAndPassword } from "firebase/auth";

// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration

const firebaseConfig = {
  apiKey: "AIzaSyDTM_ITpNgyzMEdTJgDphl5lxp82pubOuQ",
  authDomain: "jatin-auth.firebaseapp.com",
  projectId: "jatin-auth",
  storageBucket: "jatin-auth.appspot.com",
  messagingSenderId: "470357489140",
  appId: "1:470357489140:web:beafb43979385e4847b5a1",
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const auth = getAuth();

export function signup(email, password) {
  return createUserWithEmailAndPassword(auth, email, password);
}
